/*Table structure for table `erpsysuser` */

DROP TABLE IF EXISTS `erpsysuser`;

CREATE TABLE `erpsysuser` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userErp` varchar(60) NOT NULL COMMENT '用户pin',
  `username` varchar(60) NOT NULL COMMENT '用户名字',
