/*Table structure for table `resources` */

DROP TABLE IF EXISTS `resources`;

CREATE TABLE `resources` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `resourcecode` varchar(255) NOT NULL COMMENT '资源码',
  `resourcename` varchar(255) NOT NULL COMMENT '资源名字',
  `nodetype` int(2) NOT NULL COMMENT '节点类型',
  `parentcode` varchar(255) DEFAULT NULL COMMENT '上一级资源码',
  `resourceurl` varchar(255) DEFAULT NULL COMMENT '权限所对应的url地址',
  `display` bit(1) DEFAULT NULL COMMENT '是否展示',
  `displayIndex` int(11) DEFAULT NULL COMMENT '排列循序',
  `enable` bit(1) DEFAULT NULL COMMENT '状态',
  `createDate` datetime NOT NULL COMMENT '创建时间',
  `updateTime` datetime NOT NULL COMMENT '修改时间',
  `displayIndex1` int(11) DEFAULT NULL COMMENT '展示顺序',
  `resourceIcon` varchar(255) DEFAULT NULL,
  `systemcode` varchar(100) DEFAULT NULL COMMENT '系统编码(即根节点)',
  `resourceId` varchar(100) DEFAULT NULL COMMENT '资源唯一标示',
  PRIMARY KEY (`id`),
  UNIQUE KEY `resource_code_index` (`resourcecode`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4014 DEFAULT CHARSET=utf8;

