/*Table structure for table `roles` */

DROP TABLE IF EXISTS `roles`;

CREATE TABLE `roles` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `rolecode` varchar(255) NOT NULL COMMENT '角色编码',
  `rolename` varchar(255) NOT NULL COMMENT '角色名字',
  `systemcode` varchar(255) DEFAULT NULL COMMENT 'system编码',
  `enable` bit(1) DEFAULT NULL COMMENT '状态',
  `createDate` datetime DEFAULT NULL,
  `updateTime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `role_code_index` (`rolecode`) USING BTREE,
  KEY `role_systemcode_index` (`systemcode`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=217 DEFAULT CHARSET=utf8;

