/*Table structure for table `rolesresources` */

DROP TABLE IF EXISTS `rolesresources`;

CREATE TABLE `rolesresources` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `resourcecode` varchar(255) NOT NULL COMMENT '资源码',
  `resourcename` varchar(100) DEFAULT '资源名字',
  `rolecode` varchar(255) NOT NULL COMMENT '角色编码',
  `rolename` varchar(100) DEFAULT NULL COMMENT '角色名字',
  `enable` bit(1) DEFAULT NULL COMMENT '状态',
  `createDate` datetime NOT NULL,
  `updateTime` datetime NOT NULL,
  `systemcode` varchar(50) DEFAULT NULL COMMENT '系统根节点',
  PRIMARY KEY (`id`),
  UNIQUE KEY `role_resource_code_index` (`resourcecode`,`rolecode`) USING BTREE,
  KEY `role_code_index` (`rolecode`) USING BTREE,
  KEY `resource_code_index` (`resourcecode`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=117332 DEFAULT CHARSET=utf8;

