/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userpin` varchar(60) NOT NULL COMMENT '操作具体业务系统的用户id(erp或pin)',
  `username` varchar(60) NOT NULL COMMENT '用户名字',
  `enable` bit(1) DEFAULT NULL COMMENT '状态',
  `createDate` datetime NOT NULL,
  `updateTime` datetime NOT NULL,
  `email` varchar(60) DEFAULT NULL COMMENT '邮箱',
  `tel` varchar(12) DEFAULT NULL COMMENT '手机号',
  `operateErp` varchar(50) DEFAULT NULL COMMENT '添加此条记录的erp',
  `sysCodes` varchar(500) DEFAULT NULL COMMENT '所属于的系统编码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_pin` (`userpin`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=243 DEFAULT CHARSET=utf8;

