/*Table structure for table `usersroles` */

DROP TABLE IF EXISTS `usersroles`;

CREATE TABLE `usersroles` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userpin` varchar(60) NOT NULL COMMENT '用户pin',
  `username` varchar(60) NOT NULL COMMENT '用户名字',
  `rolecode` varchar(255) NOT NULL COMMENT '角色编码',
  `rolename` varchar(255) DEFAULT NULL COMMENT '角色名字',
  `enable` bit(1) DEFAULT NULL COMMENT '状态',
  `createDate` datetime NOT NULL,
  `updateTime` datetime NOT NULL,
  `systemcode` varchar(100) DEFAULT NULL COMMENT '系统编码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_pin_role_code_index` (`userpin`,`rolecode`) USING BTREE,
  KEY `user_role_code_index` (`rolecode`) USING BTREE,
  KEY `user_pin_index` (`userpin`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6141 DEFAULT CHARSET=utf8;

